"""
Generate Parentheses

Medium

Given n pairs of parentheses, write a function to generate all combinations of well-formed parentheses.

Example 1:
Input: n = 3
Output: ["((()))","(()())","(())()","()(())","()()()"]

Example 2:
Input: n = 1
Output: ["()"]
"""

# Solution

class Solution:
    def generateParenthesis(self, n: int) -> list[str]:
        # This stack (implemented as a list) will hold the current sequence of parentheses
        # as we build it up character by character.
        stack = []
        
        # This list will store all the valid combinations of parentheses we generate.
        result = []
        
        # Define the recursive backtracking function.
        # 'openN' counts the number of '(' used so far.
        # 'closeN' counts the number of ')' used so far.
        def backtracking(openN, closeN):
            # Base case: if we've used n '(' and n ')', the current combination is complete.
            if openN == closeN == n:
                # Join the list of characters into a string and add it to the results.
                result.append("".join(stack))
            
            # If we still have a chance to add an '(' (i.e., we haven't used all n yet),
            # we add '(' to the current combination.
            if openN < n:
                stack.append("(")               # Choose: add '(' to the stack.
                backtracking(openN + 1, closeN)   # Explore: recursively add the next character.
                stack.pop()                     # Un-choose: remove the last character (backtrack).
            
            # If we can add a ')', we need to ensure that the number of ')' is less than the number of '('
            # so far. This keeps the string valid (i.e., it never has more ')' than '(' at any point).
            if closeN < openN:
                stack.append(")")               # Choose: add ')' to the stack.
                backtracking(openN, closeN + 1)   # Explore: recursively add the next character.
                stack.pop()                     # Un-choose: remove the last character (backtrack).
        
        # Start the backtracking process with 0 open and 0 close parentheses used.
        backtracking(0, 0)
        
        # Return the list of all valid combinations.
        return result

